column195:
'Repository is defined as:  
  - consists of at one or more Catalog 
     {has Domain: Catalog  
       has Range: ContentCatalog, ObjectCatalog, RecordsCatalog, DataSourcecatalog}
      Catalog is a DataSet 
      a Dataset is organized in a RelationalSchema
      a RelationalSchema is defined in a Database 
      and requires a Database
      a  Database is hosted on a RDBMS {PostgreSQL,DB2,Oracle,SQLServer,CockroachDB}
      a RDBMS consists at least of one or more ObjectServer
- consists of one or more ResourceManager is equivalent to an ObjectServer 
  a Resourcemanager consists of exact one ObjectCatalog 
   and one or more StorageServer	
  a StorageServer consists of one or more StorageSystems {BlockStorage, ObjectStore, HierarchicalStore}
- enforces ReferentialqIntegrity
   ReferentialqIntegrity prevents DanglingPointers and OrphanObjects
   ReferentialqIntegrity is implemented using TwoPhaseCommitProtocol
  TwoPhaseCommitProtocol is a Service 
   is provided by a TransactionManager {Transaction Coordinator, Resource  Manager}
  supports Functional Requirement {Collect, Load, Store, Categorize, Search, Archive, Hold, Displose, transfer}
  has Componnet  {collect, load, store, query, categorize, archive, hold, displose, transfer}
  fullfills Non-FunctionalRequirement {Backup,Restore, HighAvailability,DisasterRecovery,Performance,Scalability}
 - is located in Location: any country{}
- must comply with any regulation  
 Subclass CentralRepository: 
   consits of a Cluster: is local Repository:'

